Então, vamos repetir:

Aconteceu algo que eu estava sentindo que iria acontecer: As FFAA estÃO direcionando as manifestações para os poderes políticos.
E olhando friamente, eles não estão errados, alías, estão certos.
Eles não fizeram nada de errado, aliás, não fizeram nada. Nem errado e nem certo, simplesmente nada fizeram.
O que tem que acontecer é a gente assumir o protagonismo da história.
O pedido precisa ser compreensível e inconfundível.

Quando falamos que não queremos esse governo não é FORA LULA, mas sim FORA CHAPA 13;
Quando falamos que não queremos mais ditadura, precisamos dizer: Acabem com o STF - TSE;
Quando falamos que queremos intervenção, precisamos dizer: NOVAS ELEIÇÕES JÁ.

Se só isso for pedido e for aceito, já está de bom tamanho.
Depois temos as pautas não prioritárias como:
- Lula na cadeia;
- Dissolução do Itamaraty;
- Punição de congressistas prevaricadores;
- Revisão das eleições;
etc.,

Se não formos claros nos pedidos, vai ser difícil sermos ouvidos.

Não tem mais a ver com Bolsonaro pois já saiu!!! 


* Intervenção Militar Já!!!

*Faxina nos 3 poderes (nós, opovo demitimos vocês!!!);

* Caixa auditável com comprovante do voto impresso (exigimos a entrega dos códigos fontes eleições de 2022);

*    inelegibilidade Chapa Molusco e Xuxu  (Lei da Ficha limpa).


Essas são as principais!!!

Precisamos pedir a: Condenação de corruptos e reestruturação do sistema de votação;
 Seja inelegível quem já tenha sido condenado por qualquer processo nos últimos 10 anos mesmo que em 1° instância; 
Seja preservado o princípio da moralidade no cargo;
Que seja reestabelecido o estado de Direito e que seja analisado em qual momento este deixou de ser legítimo e todos os atos que o levaram a ser ilegítimo sejam anulados ex tunc,
 Todos que atuaram para ilegitimar o Estado de Direito, sejam desligados dos cargos e julgados por uma comissão de justiça pública, sejam excluídos da vida pública de maneira vitalícia;
Novas Eleições dentro do processo atualizado,  tornando as FFAA como parte do sistema eleitoral, sendo este um tripé,  FFAA, Técnicos populares capacitados e sorteados aleatoriamente e Justiça por equipe sorteada 6 meses antes do pleito; 
Dissolução do STF com reestruturação para cargos concursados de 5 anos;
Tornar crime hediondo com confisco de bens mesmo de terceiros com vínculo para políticos e funcionários públicos que venham praticar crime de corrupção e lavagem de dinheiro;
Tornar inelegibilidade vitalícia para políticos que venham ser condenados mesmo em 1° instância por crime de corrupção, lavagem de dinheiro ou improbidade administrativa;
Reforma política e administrativa com foco em desoneração da máquina pública e sua desburocratização;
Diminuir o número de senadores para 51;
Criar colegios Eleitorais de voto por PIB estadual, votos com peso 1 , 1.5 e 2, conforme o gasto e arrecadação dos estados;

